import React from "react";

const BankDrop = () => {
    return (
        <div className="bank-drop-page">
            <h1 className="text-3xl font-bold mb-4">Bank Drop Page</h1>
            <p>This is where bank drop functionalities will be implemented.</p>
        </div>
    );
}
export default BankDrop;
